import styled from "@emotion/styled";
import { css } from "@emotion/react";
export const Layout = styled.css`
  width: 100%;
  height: 100vh;
  display: flex;
`;

export const LayoutContent = styled.css`
  max-width: calc(100% - 208px);
  flex-direction: row;
  flex-grow: 1;
  flex-wrap: wrap;
  position: relative;
`;

export const Content = styled.css`
  width: 100%;
  box-sizing: border-box;
  height: 100%;
`;
